import React from "react";
import Navbar from "../components/Navbar";
import CEOImg from "../assets/avishek.jpg"; 
import MDImg from "../assets/sushil.png"

function Team() {
  return (
    <>
      <Navbar />
      <h1 style={{ textAlign: 'center', color: '#632020' }}>About us</h1>
      <p style={{ textAlign: 'center' }}>Our team is full of passionate people and ready to make your dream software come true</p>
      <div style={{ display: 'flex', alignItems: 'center', justifyContent: 'space-around' }}>
        <div style={{ flex: 1, padding: '10px' }}>
          <img src={CEOImg} alt="CEO" style={{ maxHeight: '50%', maxWidth: '100%' }} />
          <h3>Avishek Subedi</h3>
          <h4> CEO</h4>
        </div>
        <div style={{ flex: 1, padding: '10px' }}>
          <img src={MDImg} alt="MD" style={{ maxHeight: '40%', maxWidth: '100%' }} />
        </div>
      </div>
    </>
  );
}

export default Team;
